        <h2 className="titleText">
          NUESTROS <span>P</span>RODUCTOS
        </h2>
        <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit.</p>
      </div>
      <MenuProduct src={product} title="Donas"/>
      <div className="title">
        <ButtonOption href="" className="btn" text="VER MÁS" />
      </div>
    </section>
  );
}

export default Menu;
